in vec2 vUv;
out vec4 fragColor;

uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;

#define MAX_STEPS 100
#define SURFACE_DIST 0.001
#define MAX_DIST 20.0

// Rotation matrix
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

// Gyroid formula: sin(x)cos(y) + sin(y)cos(z) + sin(z)cos(x)
float gyroid(vec3 p, float scale, float thickness, float bias) {
    p *= scale;
    return abs(dot(sin(p), cos(p.zxy)) - bias) / scale - thickness;
}

// Scene Distance Function
float scene(vec3 p) {
    // Morphing scale and movement
    vec3 p1 = p;
    p1.xy *= rot(iTime * 0.2);
    p1.yz *= rot(iTime * 0.15);

    // Primary Gyroid Layer
    float g1 = gyroid(p1, 2.5, 0.03, 0.5 * sin(iTime * 0.5));

    // Secondary detail layer
    float g2 = gyroid(p1 + iTime * 0.1, 5.0, 0.02, 0.2);

    // Combine layers and bound with a sphere
    float shape = max(g1, -g2);
    float sphere = length(p) - 2.8;

    return max(shape, sphere);
}

// Normal calculation
vec3 getNormal(vec3 p) {
    vec2 e = vec2(0.01, 0.0);
    float d = scene(p);
    vec3 n = d - vec3(
        scene(p - e.xyy),
        scene(p - e.yxy),
        scene(p - e.yyx)
    );
    return normalize(n);
}

// Simple hash for dithering
float hash(vec2 p) {
    return fract(sin(dot(p, vec2(12.9898, 78.233))) * 43758.5453);
}

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / min(iResolution.y, iResolution.x);
    vec2 m = (iMouse.xy / iResolution.xy) * 2.0 - 1.0;

    // Camera setup
    vec3 ro = vec3(0.0, 0.0, -5.0);
    vec3 rd = normalize(vec3(uv, 1.5));

    // Mouse Interaction
    ro.yz *= rot(-m.y * 1.5);
    rd.yz *= rot(-m.y * 1.5);
    ro.xz *= rot(-m.x * 3.0);
    rd.xz *= rot(-m.x * 3.0);

    // Raymarching
    float dO = 0.0;
    float glow = 0.0;
    float dS;
    vec3 p;

    for(int i = 0; i < MAX_STEPS; i++) {
        p = ro + rd * dO;
        dS = scene(p);
        dO += dS * 0.8; // Step slightly less for smoother edges

        // Accumulate glow based on proximity to the surface
        glow += 1.0 / (1.0 + dS * dS * 80.0);

        if(dO > MAX_DIST || abs(dS) < SURFACE_DIST) break;
    }

    // Coloring
    vec3 col = vec3(0.0);

    if(dO < MAX_DIST) {
        vec3 n = getNormal(p);
        vec3 lightDir = normalize(vec3(1.0, 2.0, -2.0));

        // Diffuse and Specular
        float diff = max(dot(n, lightDir), 0.0);
        float spec = pow(max(dot(reflect(-lightDir, n), -rd), 0.0), 32.0);

        // Fresnel
        float fresnel = pow(1.0 + dot(rd, n), 4.0);

        // Base color shifting over time/position
        vec3 baseCol = 0.5 + 0.5 * cos(iTime + p.xyy * 0.5 + vec3(0, 2, 4));

        col = baseCol * diff + spec + fresnel * baseCol;

        // Depth fading
        col *= exp(-0.1 * dO);
    }

    // Add volumetric-style glow
    vec3 glowColor = 0.5 + 0.4 * sin(vec3(0.0, 1.0, 2.0) + iTime * 0.8);
    glowColor *= vec3(0.1, 0.5, 1.0); // Bias towards cyber-blue/purple

    col += glowColor * glow * 0.015;

    // Background atmosphere
    col += glowColor * (1.0 / (1.0 + length(uv) * 2.0)) * 0.1;

    // Post-processing: Vignette and subtle grain
    float vignette = 1.0 - length(uv * 0.6);
    col *= vignette;
    col += (hash(uv + iTime) - 0.5) * 0.02;

    // Tonemapping
    col = smoothstep(-0.05, 1.05, col);
    col = pow(col, vec3(0.4545)); // Gamma correction

    fragColor = vec4(col, 1.0);
}
